function Todos(props) {
  console.log(props);
  console.log(props.array);

  return (
    <li
      style={{
        textDecoration: props.todo.isCompleted ? "line-through" : "none",
      }}
    >
      <input
        type="checkbox"
        checked={props.todo.isCompleted}
        onChange={() => props.completeTodo(props.todo.id)}
      />

      <span> {props.todo.text} </span>
      <button onClick={() => props.deleteTodo(props.todo.id)}>X</button>


      <input
        type="checkbox"
        checked={props.todo.isEdited}
        onChange={() => props.editTodo(props.todo.id)}
      />
{/* 
      <button onClick={() => props.editTodo(props.todo.id)}>X</button>
       */}
    </li>
  );
}

